INSERT INTO community_post (category_id, user_id, title, content, views, created_by, created_at) VALUES
(1, 1, '신입 개발자 채용 정보 공유합니다', '요즘 IT업계 채용시장이 많이 어려워졌지만 몇몇 기업에서 신입 개발자를 뽑고 있더라고요. 정보 공유드립니다. 네이버, 카카오, 라인에서 상반기 공채를 시작했습니다. 자세한 내용은 각 회사 채용페이지를 확인해보세요!', 245, 'user1', '2025-04-01 10:15:22'),
(2, 3, '백엔드vs프론트엔드 어떤 진로가 좋을까요?', '현재 컴퓨터공학과 3학년인데요, 진로를 고민하고 있습니다. 백엔드와 프론트엔드 중에서 어떤 쪽이 취업이나 향후 전망이 좋을지 조언 부탁드립니다.', 187, 'user3', '2025-04-02 14:23:11'),
(3, 5, '요즘 개발자들 주로 어떤 언어 공부하시나요?', '저는 요즘 파이썬과 자바스크립트를 주로 공부하고 있는데, 다들 어떤 언어에 집중하고 계신지 궁금합니다. 트렌드가 빠르게 변하는 것 같아서요.', 134, 'user5', '2025-04-03 09:45:33'),
(4, 7, '알고리즘 스터디원 모집합니다!', '5월부터 시작하는 알고리즘 스터디원을 모집합니다. 주 2회 온라인으로 진행할 예정이고, 백준 골드 이상 문제를 함께 풀어볼 계획입니다. 관심 있으신 분들은 댓글 남겨주세요!', 98, 'user7', '2025-04-05 16:12:45'),
(5, 10, '데이터 엔지니어 직무 관련 질문있습니다', '데이터 엔지니어 직무를 준비 중인데요, 현직자분들께서 추천하시는 필수 기술이나 공부 방향이 있을까요? 현재는 파이썬과 SQL을 중점적으로 공부하고 있습니다.', 156, 'user10', '2025-04-06 11:28:59'),
(6, 12, '2년차 개발자 이직 고민', '현재 중소기업에서 2년차 개발자로 일하고 있습니다. 이직을 고민 중인데, 2년 경력으로 좋은 회사로 이직이 가능할까요? 포트폴리오는 어떻게 준비하는 것이 좋을지 조언 부탁드립니다.', 210, 'user12', '2025-04-07 13:47:18'),
(7, 15, '회사에서 업무시간에 자기계발 하시는 분?', '다들 회사에서 업무시간에 자기계발 어떻게 하시나요? 저는 점심시간이나 약간의 여유 시간에 관련 서적을 읽거나 온라인 강의를 듣곤 합니다.', 178, 'user15', '2025-04-08 15:33:27'),
(8, 18, '최근 배운 유용한 개발 팁 공유합니다', 'Git 브랜치 전략에 대해 최근에 배운 내용을 공유드립니다. GitFlow와 GitHub Flow의 차이점과 각각의 장단점, 그리고 어떤 상황에서 어떤 전략을 사용하는 것이 좋은지에 대한 인사이트를 정리해봤습니다.', 225, 'user18', '2025-04-09 17:21:36'),
(9, 20, '대기업 인턴 후기 (긍정적)', '지난 겨울방학 동안 대기업 IT부서에서 인턴으로 일했던 경험을 공유합니다. 실무 경험도 많이 쌓고 멘토링도 잘 받아서 많이 성장할 수 있었어요. 인턴 준비하시는 분들께 도움이 됐으면 좋겠습니다.', 302, 'user20', '2025-04-10 10:05:42'),
(10, 22, '신입 개발자 기술면접 후기 및 팁', '지난주에 중견 IT기업 기술면접을 봤는데 합격했습니다! 면접에서 나온 질문들과 어떻게 준비했는지 공유드립니다. 자료구조와 알고리즘 기본기가 정말 중요하더라고요.', 289, 'user22', '2025-04-11 12:18:54'),
(1, 24, '스타트업 개발자 채용 정보', '제가 다니는 스타트업에서 백엔드 개발자를 채용하고 있습니다. 자바 스프링 경험이 있으신 분들 환영합니다. 자세한 내용은 댓글 남겨주시면 개별 안내해드릴게요.', 176, 'user24', '2025-04-12 14:37:21'),
(2, 26, '비전공자의 개발자 전환 고민', '현재 경영학과 졸업예정자인데 개발자로 진로를 바꾸고 싶습니다. 부트캠프를 다닐지, 독학을 할지 고민이에요. 비전공자분들은 어떤 방법으로 개발자가 되셨나요?', 198, 'user26', '2025-04-13 16:52:39'),
(3, 28, '개발자 번아웃 극복 방법', '요즘 일이 너무 많아서 번아웃이 온 것 같아요. 다들 이런 상황에서 어떻게 극복하시나요? 저는 취미생활을 다시 시작해보려고 합니다.', 221, 'user28', '2025-04-14 09:11:47'),
(4, 30, '리액트 스터디 모집합니다', '다음 달부터 리액트 심화 스터디를 시작합니다. Next.js와 리액트 훅에 대해 깊이 있게 공부할 예정이에요. 중급 이상 실력이신 분들 환영합니다!', 145, 'user30', '2025-04-15 11:29:08'),
(5, 32, '클라우드 엔지니어 vs 데브옵스 차이점?', '클라우드 엔지니어와 데브옵스 엔지니어의 차이점이 무엇인가요? 업무 범위와 필요한 기술 스택이 궁금합니다. 진로 결정에 참고하고 싶어요.', 167, 'user32', '2025-04-16 13:44:23'),
(6, 34, '개발자에서 PM으로 커리어 전환 고민', '5년차 개발자인데 최근에 PM으로 전환을 고민하고 있습니다. 개발자에서 PM으로 전환하신 분들의 경험담이나 조언을 듣고 싶습니다.', 189, 'user34', '2025-04-17 15:58:36'),
(7, 36, '재택근무와 사무실 근무 어떤 것이 좋을까요?', '요즘 회사들이 재택과 사무실 근무를 선택할 수 있게 하던데, 다들 어떤 방식을 선호하시나요? 각각의 장단점이 궁금합니다.', 234, 'user36', '2025-04-18 17:13:51'),
(8, 38, '도커와 쿠버네티스 입문 가이드', '최근에 도커와 쿠버네티스를 공부하면서 정리한 내용을 공유합니다. 컨테이너 기술의 기본 개념부터 실제 배포까지의 과정을 간단하게 설명했어요.', 276, 'user38', '2025-04-19 10:22:17'),
(9, 40, '중소기업 인턴 경험담', '지방 중소기업에서 인턴으로 일했던 경험을 공유합니다. 규모는 작았지만 다양한 업무를 경험할 수 있어서 많은 것을 배울 수 있었어요.', 154, 'user40', '2025-04-20 12:36:29'),
(10, 42, '코딩테스트 합격 후기 및 준비 방법', '최근 대기업 코딩테스트에 합격했습니다. 어떤 문제가 나왔고 어떻게 준비했는지 공유드립니다. 알고리즘 공부 방법도 함께 정리했어요.', 312, 'user42', '2025-04-21 14:51:38'),
(1, 44, '외국계 기업 채용 정보 및 준비 팁', '외국계 IT 기업 채용 정보와 준비 팁을 공유합니다. 영어 면접 준비 방법과 이력서 작성 요령에 대해 제 경험을 바탕으로 정리했어요.', 267, 'user44', '2025-04-22 16:07:52'),
(2, 46, '석사과정 vs 취업, 어떤 선택이 좋을까요?', '학부 졸업을 앞두고 석사과정 진학과 취업 사이에서 고민 중입니다. 각각의 장단점이나 경험담을 들려주시면 감사하겠습니다.', 203, 'user46', '2025-04-23 09:25:14'),
(3, 48, '요즘 개발자들 평균 연봉이 얼마나 되나요?', '신입부터 경력별로 개발자들 평균 연봉이 어떻게 되는지 궁금합니다. 지방과 수도권의 차이도 알고 싶어요.', 345, 'user48', '2025-04-24 11:39:27'),
(4, 50, '파이썬 알고리즘 스터디 모집', '파이썬으로 알고리즘 문제 풀이하는 스터디원을 모집합니다. 주 1회 온라인으로 진행하며, 초보자도 환영합니다!', 132, 'user50', '2025-04-25 13:54:36'),
(5, 2, 'AI 엔지니어가 되기 위한 로드맵', 'AI 엔지니어로 커리어를 시작하려고 합니다. 어떤 기술을 공부해야 하는지, 어떤 순서로 학습하는 게 좋을지 조언 부탁드립니다.', 231, 'user2', '2025-04-26 16:08:49'),
(6, 4, '10년차 개발자의 이직 경험담', '10년 동안 한 회사에서만 일하다가 최근에 이직했습니다. 오랜 경력 후의 이직 과정과 느낀 점을 공유드립니다.', 278, 'user4', '2025-04-27 18:23:05'),
(7, 6, '개발팀 내 갈등 해결 방법', '팀 내에서 의견 충돌이 있을 때 어떻게 해결하시나요? 최근에 팀원과의 갈등으로 고민이 많아서요.', 187, 'user6', '2025-04-28 10:41:17'),
(8, 8, '객체지향 프로그래밍의 핵심 원칙 정리', '객체지향 프로그래밍의 SOLID 원칙에 대해 정리했습니다. 각 원칙의 의미와 실제 코드에서 어떻게 적용되는지 예시와 함께 설명했어요.', 256, 'user8', '2025-04-29 12:56:32'),
(9, 9, '스타트업 인턴 경험담 (힘들었지만 성장했어요)', '작은 스타트업에서 인턴으로 일했던 경험을 공유합니다. 업무 강도는 높았지만 그만큼 많은 것을 배울 수 있었던 시간이었어요.', 198, 'user9', '2025-04-30 15:14:48'),
(10, 11, '신입 개발자 포트폴리오 면접 후기', '포트폴리오 위주의 개발자 면접을 봤는데 어떤 질문들이 나왔고, 어떻게 대답했는지 공유합니다. 기술적인 질문보다는 프로젝트에 대한 깊이 있는 질문이 많았어요.', 287, 'user11', '2025-05-01 17:27:59'),
(1, 13, '7월 대규모 채용 행사 정보', '7월에 열리는 IT 분야 대규모 채용 행사 정보를 공유합니다. 여러 대기업과 중견기업이 참여한다고 하니 취준생분들은 참고하세요.', 312, 'user13', '2025-05-02 09:43:12'),
(2, 14, '프로그래밍 언어 선택의 고민', '첫 프로그래밍 언어로 무엇을 배워야 할지 고민입니다. 파이썬, 자바, 자바스크립트 중에서 고민 중인데 추천해주세요.', 176, 'user14', '2025-05-03 11:58:27'),
(3, 16, '개발자 번아웃에서 회복한 경험', '심한 번아웃을 겪고 회복한 경험을 공유합니다. 어떻게 극복했는지, 그리고 앞으로 번아웃을 예방하기 위해 어떤 습관을 들이고 있는지 이야기해볼게요.', 245, 'user16', '2025-05-04 14:15:39'),
(4, 17, 'Java 스터디 그룹 모집합니다', 'Java 중급자를 위한 스터디 그룹을 모집합니다. Spring Framework를 함께 공부할 예정이며, 매주 토요일 오후에 만날 계획입니다.', 123, 'user17', '2025-05-05 16:29:54'),
(5, 19, '프론트엔드 개발자 필수 기술 스택?', '프론트엔드 개발자로 취업하기 위해 필수적으로 알아야 하는 기술 스택이 무엇인가요? HTML/CSS/JS 외에 어떤 프레임워크나 라이브러리를 공부해야 할까요?', 234, 'user19', '2025-05-06 18:42:06'),
(6, 21, '퇴사 후 프리랜서로 전환한 경험담', '회사를 퇴사하고 프리랜서 개발자로 전환한 지 6개월이 지났습니다. 장단점과 준비해야 할 것들에 대해 공유드립니다.', 298, 'user21', '2025-05-07 10:58:21'),
(7, 23, '개발자의 건강관리, 다들 어떻게 하시나요?', '장시간 앉아서 일하다 보니 허리 통증이 심해졌습니다. 개발자분들은 건강관리를 어떻게 하시는지 팁 공유 부탁드려요.', 212, 'user23', '2025-05-08 13:14:33'),
(8, 25, '마이크로서비스 아키텍처 도입 경험', '모놀리식 아키텍처에서 마이크로서비스로 전환한 경험을 공유합니다. 장단점과 주의해야 할 점들을 실제 사례와 함께 설명드릴게요.', 267, 'user25', '2025-05-09 15:27:48'),
(9, 27, '대기업 vs 스타트업 인턴, 어디가 좋을까요?', '여름방학 인턴을 준비 중인데 대기업과 유망 스타트업에서 모두 합격했습니다. 어디를 선택하는 것이 좋을까요? 각각의 장단점이 궁금합니다.', 187, 'user27', '2025-05-10 17:46:02'),
(10, 29, '기술 면접에서 자주 나오는 CS 질문 정리', '여러 회사의 기술 면접을 보면서 정리한 CS 질문들을 공유합니다. 운영체제, 네트워크, 데이터베이스 등 분야별로 정리했어요.', 345, 'user29', '2025-05-11 10:04:17'),
(1, 31, '해외 취업 정보 및 경험담', '해외 IT 기업 취업을 준비 중이신 분들을 위해 제 경험과 정보를 공유합니다. 비자 문제부터 면접 준비까지 전반적인 과정을 정리했어요.', 289, 'user31', '2025-05-12 12:19:32'),
(2, 33, '컴퓨터공학 대학원 진학 고민', '현재 학부생인데 대학원 진학을 고민 중입니다. 취업과 대학원 진학 중 어떤 선택이 좋을지, 대학원에서 어떤 연구 분야가 전망이 좋을지 조언 부탁드립니다.', 198, 'user33', '2025-05-13 14:35:47'),
(3, 35, '개발자 연봉 협상 팁 공유', '이직하면서 연봉 협상을 잘 하는 방법에 대해 제 경험을 공유합니다. 어떤 점을 어필하면 좋을지, 언제 협상을 시작하는 것이 좋은지 등에 대한 내용입니다.', 321, 'user35', '2025-05-14 16:51:08');
INSERT INTO community_comment (post_id, user_id, content, created_by, created_at) VALUES
(1, 2, '정보 감사합니다! 나도 최근에 취업 준비 중인데 도움이 되네요.', 'user2', '2025-04-01 11:30:45'),
(1, 5, '혹시 신입 개발자가 갖춰야 할 역량에 대해서도 알려주실 수 있나요?', 'user5', '2025-04-01 12:45:23'),
(2, 7, '저는 백엔드 개발자로 일하고 있는데, 백엔드가 더 안정적인 것 같아요. 하지만 적성에 맞는 걸 선택하는 게 중요합니다.', 'user7', '2025-04-02 15:12:34'),
(2, 9, '프론트엔드도 매력적인 분야예요. 사용자와 직접 소통하는 부분이 재미있습니다.', 'user9', '2025-04-02 16:28:57'),
(3, 11, '저는 요즘 Rust에 관심을 갖고 공부하고 있어요. 시스템 프로그래밍에 관심 있으시면 추천합니다!', 'user11', '2025-04-03 10:35:12'),
(3, 13, '파이썬은 진입장벽이 낮고 활용도가 높아서 좋은 선택인 것 같아요.', 'user13', '2025-04-03 11:48:36'),
(4, 15, '스터디 참여하고 싶습니다! 연락처 남깁니다.', 'user15', '2025-04-05 17:23:45'),
(4, 17, '알고리즘 스터디 좋네요. 저도 참여하고 싶습니다. 현재 실버 레벨인데 괜찮을까요?', 'user17', '2025-04-05 18:39:22'),
(5, 19, '데이터 엔지니어라면 Spark, Hadoop 같은 빅데이터 처리 기술도 공부하시면 좋을 것 같아요.', 'user19', '2025-04-06 12:15:48'),
(5, 21, '클라우드 서비스에 대한 이해도 중요합니다. AWS나 GCP 관련 자격증을 따는 것도 도움이 될 거예요.', 'user21', '2025-04-06 13:27:39'),
(6, 23, '2년 경력이면 충분히 이직 가능합니다! 포트폴리오는 본인이 맡은 프로젝트의 문제 해결 과정을 중심으로 구성하세요.', 'user23', '2025-04-07 14:55:31'),
(6, 25, '요즘은 깃허브 프로필도 포트폴리오로 많이 활용하더라고요. 꾸준한 커밋 활동이 중요합니다.', 'user25', '2025-04-07 16:08:42'),
(7, 27, '저는 점심시간에 관련 기술 블로그를 읽는 습관을 들였어요. 짧은 시간이지만 꾸준히 하니 도움이 되더라고요.', 'user27', '2025-04-08 16:44:23'),
(7, 29, '업무 시간에 배운 내용을 바로 문서화하는 것도 좋은 방법인 것 같아요. 나중에 복습하기도 좋고요.', 'user29', '2025-04-08 17:59:58'),
(8, 31, '정말 유용한 정보네요! Git 브랜치 전략은 협업에서 정말 중요한 부분인 것 같아요.', 'user31', '2025-04-09 18:32:47'),
(8, 33, '저희 회사는 GitHub Flow를 사용하고 있는데, 소규모 팀에서는 이게 더 효율적인 것 같아요.', 'user33', '2025-04-09 19:47:11'),
(9, 35, '인턴 경험 공유 감사합니다! 혹시 인턴 지원 시 포트폴리오는 어떻게 준비하셨나요?', 'user35', '2025-04-10 11:19:54'),
(9, 37, '인턴 기간 동안 배운 기술이나 툴이 있다면 공유해주세요!', 'user37', '2025-04-10 12:33:28'),
(10, 39, '면접 후기 감사합니다! 혹시 CS 기본 지식에 대한 질문도 많이 나왔나요?', 'user39', '2025-04-11 13:25:36'),
(10, 41, '기술 면접 준비 팁 정말 유용합니다. 저도 곧 면접을 앞두고 있어서 많은 도움이 됐어요.', 'user41', '2025-04-11 14:42:19'),
(11, 43, '채용 정보 감사합니다! 혹시 경력직도 뽑나요?', 'user43', '2025-04-12 15:45:12'),
(11, 45, '스타트업 환경은 어떤가요? 워라밸이 괜찮은 편인가요?', 'user45', '2025-04-12 16:59:43'),
(12, 47, '저도 비전공자 출신 개발자입니다. 부트캠프를 통해 시작했고, 체계적으로 배울 수 있어서 좋았어요.', 'user47', '2025-04-13 17:48:23'),
(12, 49, '독학도 좋지만 방향을 잡기 어려울 수 있어요. 커뮤니티 활동을 통해 피드백을 받는 게 중요합니다.', 'user49', '2025-04-13 19:02:56'),
(13, 1, '번아웃 극복을 위해서는 확실한 휴식이 필요해요. 저는 일주일 휴가를 내고 완전히 쉬었더니 도움이 됐습니다.', 'user1', '2025-04-14 10:22:38'),
(13, 3, '업무 외 취미생활을 갖는 것이 정말 중요한 것 같아요. 저는 운동을 시작했더니 스트레스 해소에 도움이 되더라고요.', 'user3', '2025-04-14 11:37:14'),
(14, 4, '리액트 스터디에 관심 있습니다! 현재 기본기는 있는 상태입니다.', 'user4', '2025-04-15 12:43:56'),
(14, 6, '온라인으로만 진행되나요? 아니면 오프라인 모임도 있나요?', 'user6', '2025-04-15 13:58:29'),
(15, 8, '클라우드 엔지니어는 클라우드 인프라 구축과 관리에 초점을 두고, 데브옵스는 개발과 운영의 통합에 초점을 둡니다.', 'user8', '2025-04-16 14:52:43'),
(15, 10, '두 직무 모두 AWS, GCP 같은 클라우드 서비스에 대한 이해가 중요합니다.', 'user10', '2025-04-16 16:07:18'),
(16, 12, '저도 개발자에서 PM으로 전환했습니다. 기술적 배경이 있으면 개발팀과 소통이 원활해서 장점이 많아요.', 'user12', '2025-04-17 17:04:52'),
(16, 14, 'PM으로 전환하기 전에 애자일 방법론이나 프로젝트 관리 툴에 대한 공부를 해보세요.', 'user14', '2025-04-17 18:19:27'),
(17, 16, '저는 주 3일 사무실, 2일 재택의 하이브리드 방식이 가장 효율적인 것 같아요.', 'user16', '2025-04-18 18:27:39'),
(17, 18, '재택근무는 집중력이 높아지는 장점이 있지만, 소통 부재로 인한 문제도 있더라고요.', 'user18', '2025-04-18 19:42:15'),
(18, 20, '도커와 쿠버네티스 가이드 정말 잘 봤습니다! 초보자도 이해하기 쉽게 설명해주셨네요.', 'user20', '2025-04-19 11:36:49'),
(18, 22, '실제 프로젝트에 적용해볼 수 있는 예제가 있으면 더 좋을 것 같아요.', 'user22', '2025-04-19 12:51:23'),
(19, 24, '중소기업 인턴도 경험을 쌓는 데 정말 좋은 것 같아요. 저도 비슷한 경험이 있는데 많이 배웠습니다.', 'user24', '2025-04-20 13:45:18'),
(19, 26, '인턴 기간 동안 가장 인상 깊었던 업무나 프로젝트가 있으신가요?', 'user26', '2025-04-20 15:03:42'),
(20, 28, '코딩테스트 준비 방법 공유 감사합니다! 혹시 추천하는 문제 풀이 사이트가 있나요?', 'user28', '2025-04-21 15:59:27'),
(20, 30, '코딩테스트에서 시간 관리는 어떻게 하셨나요? 저는 항상 시간이 부족해서 어려움을 겪고 있어요.', 'user30', '2025-04-21 17:14:59'),
(21, 32, '외국계 기업 지원 준비 중인데 정말 유용한 정보 감사합니다! 영어 면접은 어느 정도 수준이 필요한가요?', 'user32', '2025-04-22 17:21:34'),
(21, 34, '외국계 기업의 코딩테스트는 국내 기업과 많이 다른가요?', 'user34', '2025-04-22 18:36:09'),
(22, 36, '저는 석사 후 취업했는데, 연구 경험이 실무에 도움이 많이 됐어요. 관심 분야가 명확하다면 석사 추천합니다.', 'user36', '2025-04-23 10:38:45'),
(22, 38, '요즘은 특별한 이유가 없다면 바로 취업하는 것도 좋은 선택인 것 같아요. 경력을 쌓으면서 필요시 나중에 공부할 수도 있으니까요.', 'user38', '2025-04-23 11:54:21'),
(23, 40, '수도권 3-5년차 백엔드 개발자 기준으로는 5000-7000 정도가 평균인 것 같습니다.', 'user40', '2025-04-24 12:47:38'),
(23, 42, '지방과 수도권의 연봉 차이는 20-30% 정도 나는 것 같아요. 물론 회사마다 다르지만요.', 'user42', '2025-04-24 14:02:12'),
(24, 44, '파이썬 알고리즘 스터디에 참여하고 싶습니다! 초보자도 괜찮다니 다행이네요.', 'user44', '2025-04-25 15:05:54'),
(25, 48, 'AI 엔지니어를 위한 로드맵 감사합니다! 파이썬과 수학부터 차근차근 공부해야겠네요.', 'user48', '2025-04-26 17:24:03'),
(25, 50, '딥러닝 관련 추천 강의나 도서가 있을까요?', 'user50', '2025-04-26 18:37:38'),
(26, 1, '오랜 경력 후 이직하는 것도 쉽지 않았을 텐데 경험 공유 감사합니다.', 'user1', '2025-04-27 19:31:24'),
(26, 3, '이직하고 나서 적응하는 데 어려움은 없으셨나요?', 'user3', '2025-04-27 20:45:56'),
(27, 5, '팀 내 갈등은 정말 어려운 문제죠. 저는 일단 1:1로 대화를 나누는 것부터 시작하는 것이 좋다고 생각해요.', 'user5', '2025-04-28 11:54:29'),
(27, 7, '의견 충돌이 있을 때는 서로의 입장을 이해하려고 노력하는 것이 중요한 것 같아요.', 'user7', '2025-04-28 13:08:54'),
(28, 9, '객체지향 프로그래밍 원칙 정리 감사합니다! 실무에서 어떻게 적용하는지 예시가 있어서 더 이해하기 쉬웠어요.', 'user9', '2025-04-29 14:05:47'),
(28, 11, '디자인 패턴에 대한 내용도 있으면 좋을 것 같아요!', 'user11', '2025-04-29 15:19:22'),
(29, 13, '스타트업 인턴 경험 공유 감사합니다! 업무 강도가 높았다고 하셨는데 어느 정도였나요?', 'user13', '2025-04-30 16:28:34'),
(29, 15, '스타트업에서는 어떤 기술 스택을 사용하셨나요?', 'user15', '2025-04-30 17:42:09'),
(30, 17, '포트폴리오 면접 준비에 정말 도움이 될 것 같아요. 프로젝트에 대한 질문은 어떤 식으로 준비하는 것이 좋을까요?', 'user17', '2025-05-01 18:39:51'),
(30, 19, '기술적인 질문보다 프로젝트 관련 질문이 많았다니 참고가 됩니다. 감사합니다!', 'user19', '2025-05-01 19:53:26'),
(31, 21, '채용 행사 정보 감사합니다! 온라인으로도 참여할 수 있나요?', 'user21', '2025-05-02 10:55:38'),
(31, 23, '이런 채용 행사에서는 어떤 준비를 하고 가면 좋을까요?', 'user23', '2025-05-02 12:09:13'),
(32, 25, '첫 프로그래밍 언어로는 파이썬이 진입장벽이 낮아서 좋은 것 같아요.', 'user25', '2025-05-03 13:07:41'),
(32, 27, '자바스크립트도 웹 개발에 관심이 있다면 좋은 선택이 될 수 있을 것 같습니다.', 'user27', '2025-05-03 14:22:17'),
(33, 29, '번아웃 극복 경험 공유 감사합니다. 저도 비슷한 상황인데 도움이 많이 됐어요.', 'user29', '2025-05-04 15:29:54'),
(33, 31, '업무 시간 외에는 개발 관련 생각 안 하기가 중요한 것 같아요. 저도 실천 중입니다.', 'user31', '2025-05-04 16:43:27'),
(34, 33, 'Java 스터디 참여하고 싶습니다! 스프링 프레임워크에 관심이 많아요.', 'user33', '2025-05-05 17:38:19'),
(34, 35, '온라인으로만 진행되나요? 아니면 오프라인 모임도 있나요?', 'user35', '2025-05-05 18:52:53'),
(35, 37, '프론트엔드 개발자라면 React나 Vue 같은 프레임워크는 필수인 것 같아요.', 'user37', '2025-05-06 19:55:29'),
(35, 39, '최근에는 TypeScript도 많이 사용하는 추세입니다. 공부해두면 좋을 것 같아요.', 'user39', '2025-05-06 21:09:04'),
(36, 41, '프리랜서 전환 경험 공유 감사합니다! 일거리는 어떻게 구하시나요?', 'user41', '2025-05-07 12:06:43'),
(36, 43, '세금 관리나 건강보험 등의 행정적인 부분은 어떻게 하시는지 궁금합니다.', 'user43', '2025-05-07 13:20:18'),
(37, 45, '저는 서서 일할 수 있는 높이 조절 책상을 사용하고 있어요. 허리 건강에 정말 도움이 됩니다.', 'user45', '2025-05-08 14:28:56'),
(37, 47, '1-2시간마다 스트레칭을 하는 것도 좋은 습관인 것 같아요. 저는 앱 알람을 맞춰두고 있습니다.', 'user47', '2025-05-08 15:42:31'),
(38, 49, '마이크로서비스 아키텍처 관련 정보 감사합니다! 도입을 고민 중이었는데 도움이 많이 됐어요.', 'user49', '2025-05-09 16:39:57'),
(38, 2, '마이크로서비스로 전환하면서 가장 어려웠던 점은 무엇인가요?', 'user2', '2025-05-09 17:54:32'),
(39, 4, '저는 대기업 인턴 경험이 있는데, 체계적인 교육과 네트워킹이 장점이었어요.', 'user4', '2025-05-10 18:57:19'),
(39, 6, '스타트업은 다양한 경험을 할 수 있다는 점이 매력적일 것 같아요. 진로가 확실하지 않다면 추천합니다.', 'user6', '2025-05-10 20:11:54'),
(40, 8, 'CS 질문 정리 감사합니다! 면접 준비에 많은 도움이 될 것 같아요.', 'user8', '2025-05-11 11:19:42'),
(40, 10, '혹시 이 질문들에 대한 모범 답안도 공유해주실 수 있을까요?', 'user10', '2025-05-11 12:33:17'),
(41, 12, '해외 취업 정보 정말 유용합니다! 비자 문제가 가장 걱정인데 어떻게 해결하셨나요?', 'user12', '2025-05-12 13:27:49'),
(41, 14, '해외 기업은 어떤 채용 플랫폼을 통해 지원하는 것이 좋을까요?', 'user14', '2025-05-12 14:41:24'),
(42, 16, '저는 대학원에서 AI 관련 연구를 했는데, 관심 분야가 명확하다면 대학원 진학도 좋은 선택인 것 같아요.', 'user16', '2025-05-13 15:49:03'),
(42, 18, '대학원 진학 전에 현업 경험을 쌓는 것도 연구 방향을 정하는 데 도움이 될 수 있어요.', 'user18', '2025-05-13 17:02:38'),
(43, 20, '연봉 협상 팁 정말 도움이 됩니다! 이직 준비 중인데 참고할게요.', 'user20', '2025-05-14 18:04:21'),
(43, 22, '현재 연봉의 몇 퍼센트 정도 인상을 요구하는 것이 적절할까요?', 'user22', '2025-05-14 19:17:56');
